import { useEffect } from "react"

export const ClientGreeting = () => { 

    const [refresh, setRefresh] = useState(true)
    const windowAlert = () => {

        alert(`Welcome to FatBack!`)
    }

    useEffect(() => {

        fetch('http://localhost:8088/users')

            .then(response => response.json())

            .then(() => {
                setRefresh(!refresh)
            })

            .then(() => { 
                windowAlert()
            })


    },
        [])

    return (<>
        {windowAlert()}</>)

}
